import React from "react";
import { Hidden } from "reakit";

const Tree = (props) => {
  return (
    <Hidden.Container>
      {(hidden) => (
        <>
          <Hidden.Toggle {...hidden}>
            <LogoIcon src={DownArrowIcon} /> Toggle
          </Hidden.Toggle>
          <Hidden {...hidden}>Hidden</Hidden>
          <Hidden visible={hidden}></Hidden>
        </>
      )}
    </Hidden.Container>
  );
};

export default Tree;
